"use strict";var app=new Vue({el:"#vue",data:{title:"support your local artisans",text_notify:"Free Delivery over $100. Gift with Purchase over $150",show_notify:!0,show:!0,input_text:null,show_input_text:!1,templateText:"",show_time:!1,leftMouse:"left click",rightMouse:"right click",whatMouse:"",formatTime:"",products:[{id:123,title:"Pepperoni Pizza",price:24.99,discount:5,image:"image1.jpg"},{id:234,title:"Baked Pancakes",price:44.89,discount:3,image:"image1.jpg"},{id:345,title:"Avocado",price:20,image:"image1.jpg"},{id:456,title:"Bunch of Orange",price:29.99,image:"image1.jpg"}]},methods:{firstLetterToUpperCase:function(t){return t.split(" ").map(function(t){return t[0].toUpperCase()+t.slice(1)}).join(" ")},hideNotify:function(){this.show_notify=!1},showText:function(){this.show_input_text=!0,this.templateText=this.input_text,this.input_text=null},showTime:function(){this.show_time=!0;var t=new Date,e=t.getHours(),i=t.getMinutes();i<10&&(i="0"+i);t=t.getSeconds();this.formatTime=e+":"+i+":"+(t=t<10?"0"+t:t)},showMouse:function(t){this.whatMouse=t},getNewPrice:function(t){return t.discount?(t.price*(1-t.discount/100)).toFixed(2):t.price}}});